import { createRouter, createWebHistory } from 'vue-router';

import MyDashboard from '@/pages/MyDashboard.vue';
import UsersPage from '@/pages/UsersPage.vue';
import TodosPage from '@/pages/TodosPage.vue'; // Todos bileşenini içe aktarın

const routes = [
  {
    path: '/',
    name: 'MyDashboard',
    component: MyDashboard,
    children: [
      {
        path: 'users',
        name: 'users',
        component: UsersPage,
        children: [
          {
            path: ':id/todos', // Dinamik rota
            name: 'userTodos',
            component: TodosPage,
          },
        ],
      },
    ],
  },
];

const router = Router();

export default router;

function Router() {
  const router = createRouter({
    history: createWebHistory(),
    routes,
  });
  return router;
}
